const t=JSON.parse('{"key":"v-33b71f90","path":"/article/20230605-Typora%E9%87%8Cgithub%E5%9B%BE%E5%BA%8A%E7%9A%84%E5%9B%BE%E6%98%BE%E7%A4%BA%E4%B8%8D%E5%87%BA%E6%9D%A5%E7%9A%84%E9%97%AE%E9%A2%98%E8%A7%A3%E5%86%B3%E8%AE%B0%E5%BD%95.html","title":"Typora里配置的Picgo-github图床的图显示不出来","lang":"zh-CN","frontmatter":{"title":"Typora里配置的Picgo-github图床的图显示不出来","date":"2023-06-04T00:00:00.000Z","category":"github","description":"Mac PicGo 上传图片后，Typora不显示 现象 方法 通过查阅，发现问题在于Github仓库的域名raw.githubusercontent.com 的IP解析出错，需要手动配置域名解析。 打开 域名解析网站 https://www.ipaddress.com/site/raw.githubusercontent.com，查询raw.Githubusercontent.com，获取该域名的IP； 打开Mac OS终端，将hosts的域名解析添加IP与raw.Githubusercontent.com的映射关系； 打开域名映射文件/etc/hosts； sudo vim /etc/hosts 添加一行ip与域名的映射关系，保存后，重新打开Typora就发现图片可以展示了。","head":[["meta",{"property":"og:url","content":"https://vuepress-theme-hope-v2-demo.netlify.app/article/20230605-Typora%E9%87%8Cgithub%E5%9B%BE%E5%BA%8A%E7%9A%84%E5%9B%BE%E6%98%BE%E7%A4%BA%E4%B8%8D%E5%87%BA%E6%9D%A5%E7%9A%84%E9%97%AE%E9%A2%98%E8%A7%A3%E5%86%B3%E8%AE%B0%E5%BD%95.html"}],["meta",{"property":"og:site_name","content":"Yezi’s Blog"}],["meta",{"property":"og:title","content":"Typora里配置的Picgo-github图床的图显示不出来"}],["meta",{"property":"og:description","content":"Mac PicGo 上传图片后，Typora不显示 现象 方法 通过查阅，发现问题在于Github仓库的域名raw.githubusercontent.com 的IP解析出错，需要手动配置域名解析。 打开 域名解析网站 https://www.ipaddress.com/site/raw.githubusercontent.com，查询raw.Githubusercontent.com，获取该域名的IP； 打开Mac OS终端，将hosts的域名解析添加IP与raw.Githubusercontent.com的映射关系； 打开域名映射文件/etc/hosts； sudo vim /etc/hosts 添加一行ip与域名的映射关系，保存后，重新打开Typora就发现图片可以展示了。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-06-06T13:47:44.000Z"}],["meta",{"property":"article:published_time","content":"2023-06-04T00:00:00.000Z"}],["meta",{"property":"article:modified_time","content":"2023-06-06T13:47:44.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"Typora里配置的Picgo-github图床的图显示不出来\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2023-06-04T00:00:00.000Z\\",\\"dateModified\\":\\"2023-06-06T13:47:44.000Z\\",\\"author\\":[]}"]]},"headers":[{"level":2,"title":"现象","slug":"现象","link":"#现象","children":[]},{"level":2,"title":"方法","slug":"方法","link":"#方法","children":[]}],"git":{"createdTime":1686059264000,"updatedTime":1686059264000,"contributors":[{"name":"zhangting","email":"1092923594@qq.com","commits":1}]},"readingTime":{"minutes":0.58,"words":173},"filePathRelative":"article/20230605-Typora里github图床的图显示不出来的问题解决记录.md","localizedDate":"2023年6月4日","excerpt":"<h1> Mac PicGo 上传图片后，Typora不显示</h1>\\n<h2> 现象</h2>\\n<p><img src=\\"https://img-blog.csdnimg.cn/img_convert/e24d93f72ab189a46253ee93c7ad942e.png\\" alt=\\"image-20230408181149140\\"></p>\\n<h2> 方法</h2>\\n<p>通过查阅，发现问题在于Github仓库的域名<code>raw.githubusercontent.com</code> 的IP解析出错，需要手动配置域名解析。</p>\\n<ol>\\n<li>\\n<p>打开 域名解析网站 https://www.ipaddress.com/site/raw.githubusercontent.com，查询<code>raw.Githubusercontent.com</code>，获取该域名的IP；</p>\\n</li>\\n<li>\\n<p>打开Mac OS终端，将hosts的域名解析添加IP与<code>raw.Githubusercontent.com</code>的映射关系；</p>\\n</li>\\n<li>\\n<p>打开域名映射文件<code>/etc/hosts</code>；</p>\\n<div class=\\"language-bash line-numbers-mode\\" data-ext=\\"sh\\"><pre class=\\"language-bash\\"><code><span class=\\"token function\\">sudo</span> <span class=\\"token function\\">vim</span> /etc/hosts\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div></div></div></li>\\n<li>\\n<p>添加一行ip与域名的映射关系，保存后，重新打开Typora就发现图片可以展示了。</p>\\n</li>\\n</ol>","autoDesc":true}');export{t as data};
